import './App.css';
import linkedIn from "./images/linkedin-48.svg"
import github from "./images/github.png"
import { Link } from 'react-router-dom';
import styled from "styled-components";

const NavUnlisted = styled.ul`
  text-decoration: none;
`;

const StyledLink = styled(Link)`
  color: Blue;
  text-decoration: none;
  gap: 5px;
`

function App() {
  return (
    <div className="main">
      <header className="Doina's App">
      <meta name='viewport' content='width=device-width, initial-scale=1.0'></meta>
      </header>
      <h2>DC</h2>
      <div className="navbar-container">
      <NavUnlisted>
        <StyledLink to="/about">About</StyledLink>
        <StyledLink to="/projects">Projects</StyledLink>
        <StyledLink to="/experience">Experience</StyledLink>
        <form action="https://www.docdroid.net/CFYS6UG/doina-colun-resume-copy-pdf">
            <button type="submit">Resume</button>
        </form>
      </NavUnlisted>
      </div>
      <div className="personal">
        <h1>Hello, I'm Doina.</h1>
        <p>"I am a Fullstack Software Engineer with a passion for building dynamic and responsive web applications using a variety of front-end and back-end technologies."</p>
      </div>
      <div className="social">
          <a href="https://www.linkedin.com/in/doina-colun-97230a216/"><img src={linkedIn}/></a>
          <a href="https://github.com/doinyco"><img src={github}/></a>
        <footer id="footer">Doina Colun Â© 2023</footer>
      </div>
    </div>
  );
}

export default App;
